import React, {Component} from 'react';

import './Team.css';


export class Team extends Component {
  render() {
    return (
      <div className="Team col-4 row">
        {this.props.children}
      </div>
    );
  }
}


export class TeamMember extends Component {
  render() {
    return (
      <div className="Member col-2">
        <div className="MemberTitle">
          {this.props.title}
        </div>
        <div className="MemberName">
          {this.props.name}
        </div>
        <div className="MemberEmail">
          {this.props.email}
        </div>
      </div>
    );
  }
}
